import { Component } from 'react';

export const TracksResults = props => {
	return (
		<ul>
			{props.tracks.map(track => {
				return (
					<li key={track.id}>
						{track.name}+ ' ' +{track.artist.name}
					</li>
				);
			})}
		</ul>
	);
};

export default TracksResults;
